import "./Footer.scss";

export default function Footer() {
  return (
    <footer className="footer">
      <p className="footer__text">
        Designed and developed by Jack Fitgibbon - &copy; 2022
      </p>

      <nav className="footer__nav" aria-label="social links">
        <ul>
          <li className="">
            <a aria-label="github"></a>
          </li>
        </ul>
      </nav>
    </footer>
  );
}
